import React from "react";

function Contact() {
  return (
    <div>
      <p>Contact</p>
      <form class="row row-cols-lg-auto g-3 align-items-center">
        <input
          type="text"
          class="form-control"
          placeholder="Username"
          aria-label="Username"
        ></input>
      </form>
    </div>
  );
}

export default Contact;
